(286243, 'Email Template', 'Edit', 'Admin edited Hello ,\n\nThis party was on: {{SHOW_DATE}} \nat: {{SHOW_START_TIME}}\nYour character was: {{SHOW_TYPE}}\n\nClick the following link to leave feedback! Payment will be withheld until this is done. \nStaff Feedback Form  {{LINK}} \n\n(Remember to say great things about little Charlie!)\n\nWHITEBOARD IN SHED IS FOR EQUIPMENT AND COSTUME PROBLEMS\nProblems with your costume or audio equipment must be written on the whiteboard on the porch door (so we attend to it first).\n\nWarm Regards,\nStephanie Lee-Harper (The Super Party Heroes)\n(07) 3555 8019\nadmin@supersteph.com email template', '2018-04-27 22:59:25', '2018-04-27 22:59:25', '2018-04-27 22:59:25'),
