(286784, 'Email Template', 'Edit', 'Admin edited Dear {{SHOW_NAME}},\n\nThs is an automated email checking to see if you would like to cancel your party entertainment with us.\n\nTo confirm the time slot, We require a maximum of 3 days to receive payment (or a minimum of $100 deposit).\n\nOur system is noticed that your payment has not been received.\n\nYou may have been busy or may have missed the invoice requesting payment.\n\nIf you wist to lock in your entertainer, please confirm this by submitting your payment with in 24 hours of this email.\n\nIf a confirmation of payment remittance is not received with in 24 hours your entertainer may be reallocated to another party!\n\nWarm Regards, \nStephanie Lee - harper , The Super Party Heroes \n(07)35558019 email template', '2018-05-11 07:01:00', '2018-05-11 07:01:00', '2018-05-11 07:01:00'),
