(286868, 'Email Template', 'Edit', 'Admin edited Dear {{HOST}},\n\nThis is just a quick Email to say that your Super Party Heroes Entertainer is looking forward to seeing you this {{SHOW_DAY}} at {{SHOW_TIME}}!!\n\nPlease check the details below carefully, especially the date and time of your show:\n\nFee: {{FEE}}, Paid: {{PAID}}\nName: {{HOST}}\nEmail: {{EMAIL}}\nDate: {{SHOW_DAY}}, {{SHOW_DATE}}\nTime of show: {{SHOW_TIME}}\nDuration: {{DURATION}} hour\n Character: {{SHOW_TYPE}} \nShow Type: {{SHOW_DETAILS}}\nHow many Party Bags required? ($3.50 each- available only in Brisbane branch only): {{PARTY_BAGS}}\nAddress of party: {{PARTY_ADDRESS}}\nHome address: {{HOME_ADDRESS}}\nParking facilities {{PARKING_FACILITY}}\nIs the party inside or outside?: {{PARTY_IN_OUT}}\nRain contingency plans: {{RAIN_PLAN}}\nName of child: {{CHILD_NAME}}\nAge on birthday: {{AGE}}\nDate of birth: {{DOB}}\nApproximate number of children at the party: {{CHILDREN_COUNT}}\nMain age of children at the party: {{CHILDREN_PARTY}}\nBoys, girls, or mixed party?: {{GENDER_PARTY}}\nHas your child seen my show before?: {{PARTY_SEEN}} \nMobile number: {{MOBILE_NUMBER}}\n2nd mobile number (required): {{SECOND_MOBILE}}\n\nIf there is an error please call us immediately on 0411 114 709\n\nPlease Remain Contactable:\nYour Performer will call you with important information on the morning of your event. On the day of your event, should you have an emergency and need to contact the performer please do so. If you have any questions before the event please call the office on 0411 114 709.\n\n\nPerformers Details:\n{{PERFORMER_DETAILS}}\n\nHere are the Terms & Conditions www.supersteph.com/terms\nFOR A SUCCESSFUL PARTY PLEASE READ VITAL INFORMATION BELOW:\n \n1. PLEASE BE CONTACTABLE BY MOBILE PHONE THE WHOLE DAY OF THE PARTY\n(This is REALLY important as we will be running you through the show and making sure that you know what will be happening.)\n2. PARKING FESS HAVE NOT BEEN INCLUDED IN YOUR PAYMENT.\nPlease also note that any paid parking that your performer uses (if applicable, mainly CBD areas) has not been included in your payment and will need to be sorted when they arrive. \n3. KEEP FOOD AND PRESENT UNWRAPPING FOR THE END OF THE ENTERTAINMENT – PLS DO NOT GIVE THE CHILDREN FOOD TO EAT DURING THE SHOW AND NO FOOD FOR THEM TO PICK AT ON THE TABLES.\n(This will REALLY make or break your party – especially if you have a party for 5 years or under – Children need their whole attention on theirentertainer - clapping, cheering and playing games – not standing at a table of food eating fairy bread and cheerios – Don’t worry – They have plenty of time to eat after the show.)\n4. SHADE MUST BE PROVIDED FOR THE CHILDREN AND YOUR ENTERTAINER\n(26 degrees and the entertainers are in wigs, masks,rubber latex or plastic suits – running around for 1 hour– just think how hot they would feel – a 100% shaded area is a MUST on warm days – It can be a space in your house. If you are having a garden party – or in a park you MUST be near dense trees, a shaded area or set a gazebo up)\n5. DRINKS MUST BE READY FOR THE CHILDREN DURING THE SHOW\n(we have a drink stop to keep the children and your entertainer from over heating )\n6. PLEASE BE WILLING TO PARTICIPATE\n(Your show will be better with 5 mins of fun, adult participation – The children really enjoy parents joining in. You or some of your adult guests will be requested to join in on some of the party games to make your child’s party a real success. Please let your guests know so it is not a shock to them. )\n7. PLEASE BE CONSIDERATE\n(The children need to hear that one entertainer clearly. If your entertainer finds they are getting “drowned out” by the crowd of guests please help by asking your guests to talk a little lower or move into an area away from the entertainment. Children WILL lose interest if they cannot hear their entertainer.)\n8. HAVE AN EXTENSION LEAD IN THE GARDEN FOR GARDEN PARTIES\n(If it is a park party – don’t worry – we run off of batteries)\n9. HAVE A TABLE AND 2 CHAIRS READY PER FACE PAINTER (If you have booked one) \nFolding chairs or tales are perfect to set your face painter up if you are having it in a park. Or if you are having your face painter at your house have a think which of your tables you would like them to sit at to paint fun faces.\n10. GET THE BEST VALUE OUT OF YOUR ENTERTAINER & JUMPING CASTLE (If you have booked one)\nJumping castles are great fun! If you have hired one get the best out of both the jumping castle and your entertainer. Have the jumping castle up before the entertainer arrives, then turn it off when the entertainer begins performing, then turn it back on again for party-food time, right until the end of the party. \nThis will make the jumping castle seem continuously exciting! This will keep the children from being distracted from your entertainer (after all,you have paid good money to see them do a good show) , and also stop the party from \"splitting\". Splitting is the worst thing to have happen at a party. It is where the children have so much to do that they \"split off\" into little groups and the party atmosphere disappears. - Keep them having fun TOGETHER - makes great photos too!!! \n11. TIPPING - where does it go?\nThere is no expectation for you to tip. However, should you feel your performer was exceptional and wish to tip all tips go directly to your performer.\nFOR PAMPER PARTY ONLY: \nYou ARE encouraged / welcome to have a \'snack station\' with party food in the pamper party designated area (this party will revolve around several activity stations and will NOT have designated break time for food. It is best to plan cake for AFTER the pamper session has concluded).\nYou will also need to provide for a PAMPER PARTY:\nA table (6-seater size dining table or trestle table recommended) and 5 chairs\nA four-seater sofa, or four extra chairs (foot spa station - 1.5 hr + parties only)\nAn accessible powerpoint\nAccess to warm water and a microwave (2 hour parties only)\nFEATHER BOAS: We use the boas for decoration and the \"catwalk\". Feather Boas molt. Should you wish not to have bits of feather on your floor please let us know before the show and we will refrain from using them.\nWe highly recommended that these parties be held indoors, or an an undercover patio area, with space for the above plus karaoke station and craft station (provided by entertainer).\nFOR DISCO PARTIES ONLY:\nWe highly recommend that these parties be set up inside or in a garage, where light can be dimmed and there are walls for the lights to shine on. (so that the disco lights will be effective) and smoke can be used. \nFOR SPORTS PARTIES ONLY:\nWe highly recommend that these parties be held in a park or very large grassed backyard only, as a large open area is ideal for ball games and obstacle course.\n\nHave a GREAT party and I will be in touch to see how it all went next week!\n\n\nWarm Regards,\nStephanie Lee-Harper (The Super Party Heroes)\n(07) 3555 8019 email template', '2018-05-13 05:09:27', '2018-05-13 05:09:27', '2018-05-13 05:09:27'),
