(292633, 'Email Template', 'Edit', 'Admin edited <p>Dear <strong>{{SHOW_NAME}}</strong>,</p>\n<p>This is an automated email checking to see if you would like to cancel your party entertainment with us.</p>\n<p>To confirm the time slot, We require a maximum of 3 days to receive payment (or a minimum of $100 deposit).</p>\n<p>Our system is noticed that your payment has not been received.</p>\n<p>You may have been busy or may have missed the invoice requesting payment.</p>\n<p>If you wist to lock in your entertainer, please confirm this by submitting your payment with in 24 hours of this email.</p>\n<p>If a confirmation of payment remittance is not received with in 24 hours your entertainer may be reallocated to another party!</p>\n<p>Warm Regards, <br />Stephanie Lee - harper , The Super Party Heroes <br />(07)35558019</p> email template', '2018-06-10 06:56:37', '2018-06-10 06:56:37', '2018-06-10 06:56:37'),
(292634, 'Email Template', 'Edit', 'Admin edited <p>&nbsp;</p>\n<p>Unfortunately this gig has been cancelled! Probably due to the client not confirming their booking.</p>\n<p>Please reply cancellation received;</p>\n<p><br />Date: {{DATE}}</p>\n<p>Time: {{TIME}}</p>\n<p>Character: {{ROLE}}</p>\n<p>Name: {{SHOW_NAME}}</p>\n<p>Email: {{SHOW_EMAIL}}</p>\n<p>Mobile: {{PHONE}}</p>\n<p>Address: {{ADDRESS}}</p>\n<p>Child: {{CHILD_NAME}}</p>\n<p>Age: {{CHILD_AGE}} Years</p>\n<p>Warm Regards,<br />Stephanie Lee-Harper (The Super Party Heroes)<br />(07) 3555 8019<br />admin@supersteph.com</p> email template', '2018-06-10 07:04:36', '2018-06-10 07:04:36', '2018-06-10 07:04:36'),
(292635, 'Email Template', 'Edit', 'Admin edited <p>Hi {{SHOW_NAME}},</p>\n<p>We haven\'t yet received back from you any details of your party!</p>\n<p>We will need these details - not only so we know where to go, but also so we what to expect when we get there! This way we can prepare the best possible party for you and your guests!</p>\n<p>Please take a moment now to click the link below and then fill in your party details - I promise you it will only take a minute!</p>\n<p>Party Details Form: {{LINK}}</p>\n<p>We need this form to be completed and returned as soon as possible or else your Super party Hero will not be able to attend your party!</p>\n<p>If You have any question, please contact us at any time. Either by email or call the number below.</p>\n<p>Hope to hear from soon!</p>\n<p>Warm Regards,<br />Stephanie Lee-Harper (The Super Party Heroes)<br />(07) 3555 8019</p> email template', '2018-06-10 07:13:50', '2018-06-10 07:13:50', '2018-06-10 07:13:50'),
(292636, 'Booking Request', 'Assign', 'Admin assign performers for nancy 2 booking request details', '2018-06-10 07:18:10', '2018-06-10 07:18:10', '2018-06-10 07:18:10');
