(292637, 'Email Template', 'Edit', 'Admin edited <p>Dear {{HOST}},</p>\n<p>This is just a quick Email to say that your Super Party Heroes Entertainer is looking forward to seeing you this {{SHOW_DAY}} at {{SHOW_TIME}}!!</p>\n<p>Please check the details below carefully, <strong>especially the date and time of your show</strong>:</p>\n<p>Fee: {{FEE}}, Paid: {{PAID}}<br />Name: {{HOST}}<br />Email: {{EMAIL}}<br />Date: {{SHOW_DAY}}, {{SHOW_DATE}}<br />Time of show: {{SHOW_TIME}}<br />Duration: {{DURATION}} hour<br /> Character: {{SHOW_TYPE}} <br />Show Type: {{SHOW_DETAILS}}<br />How many Party Bags required? ($3.50 each- available only in Brisbane branch only): {{PARTY_BAGS}}<br />Address of party: {{PARTY_ADDRESS}}<br />Home address: {{HOME_ADDRESS}}<br />Parking facilities {{PARKING_FACILITY}}<br />Is the party inside or outside?: {{PARTY_IN_OUT}}<br />Rain contingency plans: {{RAIN_PLAN}}<br />Name of child: {{CHILD_NAME}}<br />Age on birthday: {{AGE}}<br />Date of birth: {{DOB}}<br />Approximate number of children at the party: {{CHILDREN_COUNT}}<br />Main age of children at the party: {{CHILDREN_PARTY}}<br />Boys, girls, or mixed party?: {{GENDER_PARTY}}<br />Has your child seen my show before?: {{PARTY_SEEN}} <br />Mobile number: {{MOBILE_NUMBER}}<br />2nd mobile number (required): {{SECOND_MOBILE}}</p>\n<p><strong>If there is an error please call us immediately on 0411 114 709</strong></p>\n<p><strong>Please Remain Contactable</strong>:<br />Your Performer will call you with important information on the morning of your event. On the day of your event, should you have an emergency and need to contact the performer please do so. If you have any questions before the event please call the office on 0411 114 709.</p>\n<p><br /><strong>Performers Details</strong>:<br />{{PERFORMER_DETAILS}}</p>\n<p>Here are the <a href=\"http://www.supersteph.com/terms\">Terms &amp; Conditions</a></p>\n<p><span style=\"color: #ff0000;\"><strong>FOR A SUCCESSFUL PARTY PLEASE READ VITAL INFORMATION BELOW:</strong></span></p>\n<p><strong>1. PLEASE BE CONTACTABLE BY MOBILE PHONE THE WHOLE DAY OF THE PARTY</strong><br />(This is REALLY important as we will be running you through the show and making sure that you know what will be happening.)</p>\n<p><strong>2. PARKING FESS HAVE NOT BEEN INCLUDED IN YOUR PAYMENT.</strong><br />Please also note that any paid parking that your performer uses (if applicable, mainly CBD areas) has not been included in your payment and will need to be sorted when they arrive. <br /><strong>3. KEEP FOOD AND PRESENT UNWRAPPING FOR THE END OF THE ENTERTAINMENT &ndash; PLS DO NOT GIVE THE CHILDREN FOOD TO EAT DURING THE SHOW AND NO FOOD FOR THEM TO PICK AT ON THE TABLES.</strong><br />(This will REALLY make or break your party &ndash; especially if you have a party for 5 years or under &ndash; Children need their whole attention on theirentertainer - clapping, cheering and playing games &ndash; not standing at a table of food eating fairy bread and cheerios &ndash; Don&rsquo;t worry &ndash; They have plenty of time to eat after the show.)<br /><strong>4. SHADE MUST BE PROVIDED FOR THE CHILDREN AND YOUR ENTERTAINER</strong><br />(26 degrees and the entertainers are in wigs, masks,rubber latex or plastic suits &ndash; running around for 1 hour&ndash; just think how hot they would feel &ndash; a 100% shaded area is a MUST on warm days &ndash; It can be a space in your house. If you are having a garden party &ndash; or in a park you MUST be near dense trees, a shaded area or set a gazebo up)<br /><strong>5. DRINKS MUST BE READY FOR THE CHILDREN DURING THE SHOW</strong><br />(we have a drink stop to keep the children and your entertainer from over heating )<br /><strong>6. PLEASE BE WILLING TO PARTICIPATE</strong><br />(Your show will be better with 5 mins of fun, adult participation &ndash; The children really enjoy parents joining in. You or some of your adult guests will be requested to join in on some of the party games to make your child&rsquo;s party a real success. Please let your guests know so it is not a shock to them. )<br /><strong>7. PLEASE BE CONSIDERATE</strong><br />(The children need to hear that one entertainer clearly. If your entertainer finds they are getting &ldquo;drowned out&rdquo; by the crowd of guests please help by asking your guests to talk a little lower or move into an area away from the entertainment. Children WILL lose interest if they cannot hear their entertainer.)<br /><strong>8. HAVE AN EXTENSION LEAD IN THE GARDEN FOR GARDEN PARTIES</strong><br />(If it is a park party &ndash; don&rsquo;t worry &ndash; we run off of batteries)<br /><strong>9. HAVE A TABLE AND 2 CHAIRS READY PER FACE PAINTER (If you have booked one)</strong> <br />Folding chairs or tales are perfect to set your face painter up if you are having it in a park. Or if you are having your face painter at your house have a think which of your tables you would like them to sit at to paint fun faces.<br /><strong>10. GET THE BEST VALUE OUT OF YOUR ENTERTAINER &amp; JUMPING CASTLE (If you have booked one)</strong><br />Jumping castles are great fun! If you have hired one get the best out of both the jumping castle and your entertainer. Have the jumping castle up before the entertainer arrives, then turn it off when the entertainer begins performing, then turn it back on again for party-food time, right until the end of the party. <br />This will make the jumping castle seem continuously exciting! <strong>This will keep the children from being distracted from your entertainer (after all,you have paid good money to see them do a good show) , and also stop the party from \"splitting\". Splitting is the worst thing to have happen at a party. It is where the children have so much to do that they \"split off\" into little groups and the party atmosphere disappears. - Keep them having fun TOGETHER - makes great photos too!!!</strong> <br /><strong>11. TIPPING - where does it go?</strong><br />There is no expectation for you to tip. However, should you feel your performer was exceptional and wish to tip all tips go directly to your performer.<br /><strong>FOR PAMPER PARTY ONLY:</strong> <br />You ARE encouraged / welcome to have a \'snack station\' with party food in the pamper party designated area (this party will revolve around several activity stations and will NOT have designated break time for food. It is best to plan cake for AFTER the pamper session has concluded).<br />You will also need to provide for a PAMPER PARTY:</p>\n<ul>\n<li>A table (6-seater size dining table or trestle table recommended) and 5 chairs</li>\n<li>A four-seater sofa, or four extra chairs (foot spa station - 1.5 hr + parties only)</li>\n<li>An accessible powerpoint</li>\n<li>Access to warm water and a microwave (2 hour parties only)</li>\n</ul>\n<p><br /><strong>FEATHER BOAS: We use the boas for decoration and the \"catwalk\". Feather Boas molt. Should you wish not to have bits of feather on your floor please let us know before the show and we will refrain from using them.</strong><br />We highly recommended that these parties be held indoors, or an an undercover patio area, with space for the above plus karaoke station and craft station (provided by entertainer).<br /><strong>FOR DISCO PARTIES ONLY:</strong><br />We highly recommend that these parties be set up inside or in a garage, where light can be dimmed and there are walls for the lights to shine on. (so that the disco lights will be effective) and smoke can be used. <br /><strong>FOR SPORTS PARTIES ONLY:</strong><br />We highly recommend that these parties be held in a park or very large grassed backyard only, as a large open area is ideal for ball games and obstacle course.</p>\n<p>Have a GREAT party and I will be in touch to see how it all went next week!</p>\n<p><br />Warm Regards,<br />Stephanie Lee-Harper (The Super Party Heroes)<br />(07) 3555 8019</p> email template', '2018-06-10 07:29:02', '2018-06-10 07:29:02', '2018-06-10 07:29:02'),
(292638, 'Email Template', 'Edit', 'Admin edited <p>Dear {{HOST}} ,</p>\n<p>I just wanted to take a few seconds to say thank you for inviting {{PERFORMER_DETAILS}} along to your event .{{PERFORMER_DETAILS}} said that it was such fun time !.</p>\n<p>{{FEEDBACKS}}</p>\n<p>If its no trouble ,We would be really grateful if you could pop your Super Parties Heroes experience on our review page for other mums and dads to read .</p>\n<p>Please review us on <a href=\"https://www.google.com.au/maps/place/SuperSteph+and+the+Super+Party+Heroes/@-27.5282332,152.4734415,9z/data=!4m7!3m6!1s0x6b915abda8de647f:0x6f8f7331a51ab0cc!8m2!3d-27.530575!4d153.033908!9m1!1b1\">Google+</a> or <a href=\"https://www.google.com.au/maps/place/SuperSteph+and+the+Super+Party+Heroes/@-27.5282332,152.4734415,9z/data=!4m7!3m6!1s0x6b915abda8de647f:0x6f8f7331a51ab0cc!8m2!3d-27.530575!4d153.033908!9m1!1b1\">Gmail</a> ,or on <a href=\"https://www.wordofmouth.com.au/reviews/supersteph-and-the-super-party-heroes\">WOMO</a> , or on <a href=\"https://www.facebook.com/pg/supersteph/reviews/\">Facebook</a> - We would really appreciate it .</p>\n<p>We LOVE to see the photos from the party and your performer in action ! again if you have a spare minute , We invite you to share your best photos at our <a href=\"https://www.facebook.com/pg/supersteph/reviews/\">Facebook page</a> :)</p>\n<p>Do you have any criticisms or any helpfu hints regarding your show or performer ? Please let us know - We want to deliver 100% satisfaction :D</p>\n<p>Thanks so much for choosing us for your event .</p>\n<p>Warm Regards ,<br />Stephanie Lee-Harper (Tha Super Party Heroes)</p> email template', '2018-06-10 07:36:53', '2018-06-10 07:36:53', '2018-06-10 07:36:53'),
