(292763, 'Email Template', 'Edit', 'Admin edited <p>Dear {{HOST}},</p>\n<p>I just wanted to take a few seconds to say thank you for inviting {{PERFORMER_DETAILS}} along to your event .{{PERFORMER_DETAILS}} said that it was such fun time !.</p>\n<p>{{FEEDBACKS}}</p>\n<p>If its no trouble ,We would be really grateful if you could pop your Super Parties Heroes experience on our review page for other mums and dads to read.</p>\n<p>Please review us on <a href=\"https://www.google.com.au/maps/place/SuperSteph+and+the+Super+Party+Heroes/@-27.5282332,152.4734415,9z/data=!4m7!3m6!1s0x6b915abda8de647f:0x6f8f7331a51ab0cc!8m2!3d-27.530575!4d153.033908!9m1!1b1\">Google+</a> or <a href=\"https://www.google.com.au/maps/place/SuperSteph+and+the+Super+Party+Heroes/@-27.5282332,152.4734415,9z/data=!4m7!3m6!1s0x6b915abda8de647f:0x6f8f7331a51ab0cc!8m2!3d-27.530575!4d153.033908!9m1!1b1\"> Gmail </a> ,or on <a href=\"https://www.wordofmouth.com.au/reviews/supersteph-and-the-super-party-heroes\">WOMO</a> , or on <a href=\"https://www.facebook.com/pg/supersteph/reviews/\">Facebook</a> - We would really appreciate it .</p>\n<p>We LOVE to see the photos from the party and your performer in action ! again if you have a spare minute , We invite you to share your best photos at our <a href=\"https://www.facebook.com/pg/supersteph/reviews/\">Facebook page</a> :)</p>\n<p>Do you have any criticisms or any helpfu hints regarding your show or performer ? Please let us know - We want to deliver 100% satisfaction :D</p>\n<p>Thanks so much for choosing us for your event .</p>\n<p>Warm Regards ,<br />Stephanie Lee-Harper (Tha Super Party Heroes)</p> email template', '2018-06-12 07:50:51', '2018-06-12 07:50:51', '2018-06-12 07:50:51'),
