(294995, 'Email Template', 'Edit', 'Admin edited <p>This is just an automated email to let you know that we haven\'t received your payment and therefore your party has been removed from our schedule to free up slots for other parties. If this is in error, please call our office immediately at the number below. </p>\n\n <p>Otherwise, we\'re sorry to see you go. Remember to take lots of photos, they grow up so quickly!</p> \n\n<p>Date: {{DATE}}\n<br/>Time: {{TIME}}\n<br/>Character: {{ROLE}}\n<br/>Name: {{SHOW_NAME}}\n<br/>Email: {{SHOW_EMAIL}}\n<br/>Mobile: {{PHONE}}\n<br/>Address: {{ADDRESS}}\n<br/>Child: {{CHILD_NAME}}\n<br/>Age: {{CHILD_AGE}} Years</p> <p> <b>Warm Regards,</b><br />Stephanie Lee-Harper (The Super Party Heroes)<br />(07) 3555 8019\n<br/>admin@supersteph.com</p> email template', '2018-07-10 13:51:41', '2018-07-10 13:51:41', '2018-07-10 13:51:41'),
(294996, 'Email Template', 'Edit', 'Admin edited <p>Dear {{HOST}},</p>\n<p>I just wanted to take a few seconds to say thank you for inviting {{PERFORMER_DETAILS}} along to your event .{{PERFORMER_DETAILS}} said that it was such fun time !.</p>\n<p>{{FEEDBACKS}}</p>\n<p>If it\'s no trouble, We would be really grateful if you could pop your Super Parties Heroes experience on our review page for other mums and dads to read.</p>\n<p>Please review us on <a href=\"https://www.google.com.au/maps/place/SuperSteph+and+the+Super+Party+Heroes/@-27.5282332,152.4734415,9z/data=!4m7!3m6!1s0x6b915abda8de647f:0x6f8f7331a51ab0cc!8m2!3d-27.530575!4d153.033908!9m1!1b1\">Google+</a> or <a href=\"https://www.google.com.au/maps/place/SuperSteph+and+the+Super+Party+Heroes/@-27.5282332,152.4734415,9z/data=!4m7!3m6!1s0x6b915abda8de647f:0x6f8f7331a51ab0cc!8m2!3d-27.530575!4d153.033908!9m1!1b1\"> Gmail </a> ,or on <a href=\"https://www.wordofmouth.com.au/reviews/supersteph-and-the-super-party-heroes\">WOMO</a> , or on <a href=\"https://www.facebook.com/pg/supersteph/reviews/\">Facebook</a> - We would really appreciate it .</p>\n<p>OHH We also would LOVE to see some photos from the party and your performer in action! (again if you have a spare minute) , We invite you to share your best photos at our <a href=\"https://www.facebook.com/pg/supersteph/reviews/\">Facebook page</a> :)</p>\n<p>Do you have any criticisms or any helpfu hints regarding your show or performer ? Please let us know - We want to deliver 100% satisfaction :D</p>\n<p>Thanks so much for choosing us for your event .</p>\n<p>Warm Regards ,<br />Stephanie Lee-Harper (The Super Party Heroes)</p> email template', '2018-07-10 14:52:00', '2018-07-10 14:52:00', '2018-07-10 14:52:00'),
(294997, 'Email Template', 'Edit', 'Admin edited <p>Hi, \n<br><br>\nThis gig has been updated. Please check the details below;\n<br>\nPlease reply \'Update received.\'\n<br>\nDate:<b> {{SHOW_DATE}} </b> <br>\nTime: <b> {{SHOW_TIME}} </b>   <br>\nDuration:<b>  {{DURATION}} hour  </b>  <br>\nType:<b>  {{SHOW_TYPE}} </b>  <br>\nCharacter: <b>  {{CHARACTER}} </b>  <br>\nName:<b> {{HOST}} </b>    <br>\nEmail:<b>  {{EMAIL}} </b>   <br>\nMobile: <b> {{MOBILE}} </b>   <br>\nAddress:<b>  {{PARTY_ADDRESS}}   </b> <br>\nChild:<b>  {{CHILD_NAME}} </b> <br>\nAge: <b> {{AGE}} </b>  <br>\n<br>\n<br>\n<b>Warm Regards, </b> </br>\nStephanie Lee-Harper </br>\nSuper Party Heroes </br>\n(07)35558019\n</p> email template', '2018-07-10 14:53:22', '2018-07-10 14:53:22', '2018-07-10 14:53:22'),
(294998, 'Email Template', 'Edit', 'Admin edited <p>Hi, {{PERFORMER_DETAILS}},\n<br><br>\nThis gig has been updated. Please check the details below;\n<br>\nPlease reply \'Booking received and accepted.\'\n<br>\nDate:<b> {{SHOW_DATE}} </b> <br>\nTime: <b> {{SHOW_TIME}} </b>   <br>\nDuration:<b>  {{DURATION}} hour  </b>  <br>\nType:<b>  {{SHOW_TYPE}} </b>  <br>\nCharacter: <b>  {{CHARACTER}} </b>  <br>\nName:<b> {{HOST}} </b>    <br>\nEmail:<b>  {{EMAIL}} </b>   <br>\nMobile: <b> {{MOBILE}} </b>   <br>\nAddress:<b>  {{PARTY_ADDRESS}}   </b> <br>\nChild:<b>  {{CHILD_NAME}} </b> <br>\nAge: <b> {{AGE}} </b>  <br>\n<br>\n<br>\n<b>Warm Regards, </b> </br>\nStephanie Lee-Harper </br>\nSuper Party Heroes </br>\n(07)35558019\n</p> email template', '2018-07-10 14:56:49', '2018-07-10 14:56:49', '2018-07-10 14:56:49'),
(294999, 'Email Template', 'Edit', 'Admin edited <p>Hi {{PERFORMER_DETAILS}},\n<br><br>\nThis gig has been updated. Please check the details below;\n<br>\nPlease reply \'Booking received and accepted.\'\n<br>\nDate:<b> {{SHOW_DATE}} </b> <br>\nTime: <b> {{SHOW_TIME}} </b>   <br>\nDuration:<b>  {{DURATION}} hour  </b>  <br>\nType:<b>  {{SHOW_TYPE}} </b>  <br>\nCharacter: <b>  {{CHARACTER}} </b>  <br>\nName:<b> {{HOST}} </b>    <br>\nEmail:<b>  {{EMAIL}} </b>   <br>\nMobile: <b> {{MOBILE}} </b>   <br>\nAddress:<b>  {{PARTY_ADDRESS}}   </b> <br>\nChild:<b>  {{CHILD_NAME}} </b> <br>\nAge: <b> {{AGE}} </b>  <br>\n<br>\n<br>\n<b>Warm Regards, </b> </br>\nStephanie Lee-Harper </br>\nSuper Party Heroes </br>\n(07)35558019\n</p> email template', '2018-07-10 14:57:34', '2018-07-10 14:57:34', '2018-07-10 14:57:34'),
(295000, 'Email Template', 'Edit', 'Admin edited <p>Hi {{PERFORMER_DETAILS}},  <br> <br>\n\nThis Gig has been reinstated. YAY!<br>\n\nPlease reply \'Booking received and accepted.\'<br>\n<br>\nDate: {{SHOW_DATE}} <br>\nStart Time: {{SHOW_START_TIME}}<br>\n Character: {{SHOW_TYPE}} <br>\nShow Type: {{SHOW_DETAILS}}<br>\n<br>\nWarm Regards,<br>\nStephanie Lee - harper , The Super Party Heroes <br>\n(07)35558019<br> </p> email template', '2018-07-10 14:58:44', '2018-07-10 14:58:44', '2018-07-10 14:58:44'),
(295001, 'Email Template', 'Edit', 'Admin edited <p>Dear <strong>{{SHOW_NAME}}</strong>,</p>\n<p>This is an automated email checking to see if you would like to cancel your party entertainment with us.</p>\n<p>Our system is noticed that your payment has not been received within the 3 days period. To confirm the time slot, The booking requires full payment (or a minimum of $100 deposit)</p>\n\n<p>You may have been busy or may have missed the invoice requesting payment. (which we totally understood) If you still wish to keep the booking, please confirm this by submitting your payment with in 24 hours of this email or call 3555 8019 for payment over the phone</p>\n<p>If a confirmation of payment remittance is not received within 24 hours, your hired entertainer may be reallocated to another party!</p>\n<p><b>Warm Regards, </b> <br />Stephanie Lee - harper <br>\nSuper Party Heroes <br />(07)35558019</p> email template', '2018-07-10 15:07:48', '2018-07-10 15:07:48', '2018-07-10 15:07:48'),
(295002, 'Email Template', 'Edit', 'Admin edited <p>Hi {{SHOW_NAME}},</p>\n<p>It looks like we haven\'t received the details of your party just yet! We will need these details - not only so we know where to go, but also what to expect when we get there. This way we can prepare the best possible party for you and your guests. YAY!</p>\n<p>Please take a moment to click the link below to fill in your party details. (I promise, it\'ll only take a minute!) :D </p>\n<p> <a href=\"{{LINK}}\" >Party Details Form</a></p>\n<p>We will need the form filled out as soon as possible, otherwise your Super party Hero will not be able to attend your party! Thanks so much for your cooperation.</p>\n<p>Should you have any question or clarifications at all, please feel free to contact us at any time. I look forward to hearing from you soon. :D </p>\n<p><b>Warm Regards, </b> <br />Stephanie Lee-Harper <br>\nSuper Party Heroes<br />(07) 3555 8019</p> email template', '2018-07-10 15:13:47', '2018-07-10 15:13:47', '2018-07-10 15:13:47'),
