(295012, 'Email Template', 'Edit', 'Admin edited <p>Dear {{FIRST_NAME}},</p>\n<p>We have penciled you in for a <strong>{{SHOW_TEXT}}</strong> show,</p>\n<p>On: <strong>{{SHOW_DATE}}</strong> <strong>(a {{DAY}})</strong></p>\n<p>At: <strong>{{SHOW_START_TIME}}</strong></p>\n<p>Duration of the show: <strong>{{DURATION}} </strong></p>\n<p>Your chosen character is: <strong>{{SHOW_TYPE}}</strong></p>\n<p>Total amount due: <strong>${{FEE}}</strong></p>\n<p>There is a &ldquo;temporary hold&rdquo; for your booking.</p>\n<p>To confirm your booking:</p>\n<ul>\n<li>Please pay your invoice within 72 hours</li>\n<li>Fill out the booking form <a href=\"{{LINK}}\">HERE </a> </li>\n</ul>\n<p>Please check the <a href=\"http://www.supersteph.com/terms\">terms and conditions</a> for cancellation policy.</p>\n<p>Warm Regards,</br>\nStephanie Lee-Harper (The Super Party Heroes)</br>\n(07) 3555 8019</br>\nadmin@supersteph.com</p> email template', '2018-07-11 01:14:01', '2018-07-11 01:14:01', '2018-07-11 01:14:01'),
