(295055, 'Email Template', 'Edit', 'Admin edited Hello ,<br><br>\n\nThis party was on: {{SHOW_DATE}} <br>\nat: {{SHOW_START_TIME}}<br>\nYour character was: {{SHOW_TYPE}}<br>\nShow Type : {{SHOW_DETAILS}}<br>\nChild Name :{{CHILD_NAME}}<br><br>\n\nClick the following link to leave feedback! Payment will be withheld until this is done. <br>\n {{LINK}} <br><br>\n\n(Remember to say great things about little {{CHILD_NAME}})<br><br>\n\nWHITEBOARD IN SHED IS FOR EQUIPMENT AND COSTUME PROBLEMS<br>\nProblems with your costume or audio equipment must be written on the whiteboard on the porch door (so we attend to it first).<br><br>\n<br>\n<b>Warm Regards,</b><br>\nStephanie Lee-Harper <br>\nSuper Party Heroes<br>\n(07) 3555 8019<br>\nadmin@supersteph.com<br> email template', '2018-07-12 11:33:53', '2018-07-12 11:33:53', '2018-07-12 11:33:53'),
(295056, 'Email Template', 'Edit', 'Admin edited <p>This Gig has been UPDATED.\n<br><br>\nPlease check the details below carefully, especially the date and time of your show:\n<a href=\"{{ACCEPT}}\" > CLICK HERE! </a>\n<br><br>\nFee :<b> {{FEE}} </b><br>\nDate: <b>{{SHOW_DATE}}</b> <br>\nTime of show: <b>{{SHOW_START_TIME}} </b><br>\nDuration :<b>  {{DURATION}} </b>  <br>\nCharacter: <b>{{SHOW_TYPE}} </b> <br>\nShow Type:<b> {{SHOW_DETAILS}}</b> <br>\nName: <b>{{HOST}} </b><br> \nEmail: <b>{{EMAIL}} </b><br>\nMobile: <b>{{MOBILE_NUMBER}} </b><br>\nAddress:<b> {{PARTY_ADDRESS}} </b><br>\nChild: <b>{{CHILD_NAME}} </b><br>\nAge: <b>{{AGE}}</b><br>\n<br>\nIf there is an error please call us immediately at 3555 8019\n<br>\n<br>\n\n<b>Warm Regards,  </b>\n<br>\nStephanie Lee-Harper\n<br>Super Party Heroes\n<br>\n(07) 3555 8019\n\n</p> email template', '2018-07-12 11:54:56', '2018-07-12 11:54:56', '2018-07-12 11:54:56'),
(295057, 'Email Template', 'Edit', 'Admin edited <p>Dear <strong>{{SHOW_NAME}}</strong>,</p>\n<p>This is an automated email to check if you would like to cancel your party entertainment with us.</p>\n<p>Our system noticed that there were no payment made within the 3 days period. To confirm the time slot, The booking requires full payment (or a minimum of $100 deposit)</p>\n\n<p>You may have been busy or may have missed the invoice requesting payment. (which we totally understood) If you still wish to keep the booking, please confirm this by submitting your payment within 24 hours of this email or call 3555 8019 for payment over the phone</p>\n<p>If a confirmation of payment remittance is not received within 24 hours, your hired entertainer may be reallocated to another party!</p>\n<p><b>Warm Regards, </b> <br />Stephanie Lee - harper <br>\nSuper Party Heroes <br />(07)35558019</p> email template', '2018-07-12 11:58:30', '2018-07-12 11:58:30', '2018-07-12 11:58:30'),
(295058, 'Email Template', 'Edit', 'Admin edited <p>Dear {{HOST}},</p>\n<p>This is just a quick Email to say that your Super Party Heroes Entertainer is looking forward to seeing you this {{SHOW_DAY}} at {{SHOW_TIME}}!!</p>\n<p>Please check the details below carefully, <strong>especially the date and time of your show</strong>:</p>\n<p>Fee: {{FEE}}, Paid: {{PAID}}<br />Name: {{HOST}}<br />Email: {{EMAIL}}<br />Date: {{SHOW_DAY}}, {{SHOW_DATE}}<br />Time of show: {{SHOW_TIME}}<br />Duration: {{DURATION}} <br /> Character: {{SHOW_TYPE}} <br />Show Type: {{SHOW_DETAILS}}<br />How many Party Bags required? ($3.50 each- available only in Brisbane branch only): {{PARTY_BAGS}}<br />Address of party: {{PARTY_ADDRESS}}<br />Home address: {{HOME_ADDRESS}}<br />Parking facilities {{PARKING_FACILITY}}<br />Is the party inside or outside?: {{PARTY_IN_OUT}}<br />Rain contingency plans: {{RAIN_PLAN}}<br />Name of child: {{CHILD_NAME}}<br />Age on birthday: {{AGE}}<br />Date of birth: {{DOB}}<br />Approximate number of children at the party: {{CHILDREN_COUNT}}<br />Main age of children at the party: {{CHILDREN_PARTY}}<br />Boys, girls, or mixed party?: {{GENDER_PARTY}}<br />Has your child seen my show before?: {{PARTY_SEEN}} <br />Mobile number: {{MOBILE_NUMBER}}<br />2nd mobile number (required): {{SECOND_MOBILE}}</p>\n<p><strong>If there is an error please call us immediately on 0411 114 709</strong></p>\n<p><strong>Please Remain Contactable</strong>:<br />Your Performer will call you with important information on the morning of your event. On the day of your event, should you have an emergency and need to contact the performer please do so. If you have any questions before the event please call the office on 0411 114 709.</p>\n<p><br /><strong>Performers Details</strong>:<br />{{PERFORMER_DETAILS}}</p>\n<p>Here are the <a href=\"http://www.supersteph.com/terms\">Terms &amp; Conditions</a></p>\n<p><span style=\"color: #ff0000;\"><strong>FOR A SUCCESSFUL PARTY PLEASE READ VITAL INFORMATION BELOW:</strong></span></p>\n<p><strong>1. PLEASE BE CONTACTABLE BY MOBILE PHONE THE WHOLE DAY OF THE PARTY</strong><br />(This is REALLY important as we will be running you through the show and making sure that you know what will be happening.)</p>\n<p><strong>2. PARKING FESS HAVE NOT BEEN INCLUDED IN YOUR PAYMENT.</strong><br />Please also note that any paid parking that your performer uses (if applicable, mainly CBD areas) has not been included in your payment and will need to be sorted when they arrive. <br /><strong>3. KEEP FOOD AND PRESENT UNWRAPPING FOR THE END OF THE ENTERTAINMENT &ndash; PLS DO NOT GIVE THE CHILDREN FOOD TO EAT DURING THE SHOW AND NO FOOD FOR THEM TO PICK AT ON THE TABLES.</strong><br />(This will REALLY make or break your party &ndash; especially if you have a party for 5 years or under &ndash; Children need their whole attention on theirentertainer - clapping, cheering and playing games &ndash; not standing at a table of food eating fairy bread and cheerios &ndash; Don&rsquo;t worry &ndash; They have plenty of time to eat after the show.)<br /><strong>4. SHADE MUST BE PROVIDED FOR THE CHILDREN AND YOUR ENTERTAINER</strong><br />(26 degrees and the entertainers are in wigs, masks,rubber latex or plastic suits &ndash; running around for 1 hour&ndash; just think how hot they would feel &ndash; a 100% shaded area is a MUST on warm days &ndash; It can be a space in your house. If you are having a garden party &ndash; or in a park you MUST be near dense trees, a shaded area or set a gazebo up)<br /><strong>5. DRINKS MUST BE READY FOR THE CHILDREN DURING THE SHOW</strong><br />(we have a drink stop to keep the children and your entertainer from over heating )<br /><strong>6. PLEASE BE WILLING TO PARTICIPATE</strong><br />(Your show will be better with 5 mins of fun, adult participation &ndash; The children really enjoy parents joining in. You or some of your adult guests will be requested to join in on some of the party games to make your child&rsquo;s party a real success. Please let your guests know so it is not a shock to them. )<br /><strong>7. PLEASE BE CONSIDERATE</strong><br />(The children need to hear that one entertainer clearly. If your entertainer finds they are getting &ldquo;drowned out&rdquo; by the crowd of guests please help by asking your guests to talk a little lower or move into an area away from the entertainment. Children WILL lose interest if they cannot hear their entertainer.)<br /><strong>8. HAVE AN EXTENSION LEAD IN THE GARDEN FOR GARDEN PARTIES</strong><br />(If it is a park party &ndash; don&rsquo;t worry &ndash; we run off of batteries)<br /><strong>9. HAVE A TABLE AND 2 CHAIRS READY PER FACE PAINTER (If you have booked one)</strong> <br />Folding chairs or tales are perfect to set your face painter up if you are having it in a park. Or if you are having your face painter at your house have a think which of your tables you would like them to sit at to paint fun faces.<br /><strong>10. GET THE BEST VALUE OUT OF YOUR ENTERTAINER &amp; JUMPING CASTLE (If you have booked one)</strong><br />Jumping castles are great fun! If you have hired one get the best out of both the jumping castle and your entertainer. Have the jumping castle up before the entertainer arrives, then turn it off when the entertainer begins performing, then turn it back on again for party-food time, right until the end of the party. <br />This will make the jumping castle seem continuously exciting! <strong>This will keep the children from being distracted from your entertainer (after all,you have paid good money to see them do a good show) , and also stop the party from \"splitting\". Splitting is the worst thing to have happen at a party. It is where the children have so much to do that they \"split off\" into little groups and the party atmosphere disappears. - Keep them having fun TOGETHER - makes great photos too!!!</strong> <br /><strong>11. TIPPING - where does it go?</strong><br />There is no expectation for you to tip. However, should you feel your performer was exceptional and wish to tip all tips go directly to your performer.<br /><strong>FOR PAMPER PARTY ONLY:</strong> <br />You ARE encouraged / welcome to have a \'snack station\' with party food in the pamper party designated area (this party will revolve around several activity stations and will NOT have designated break time for food. It is best to plan cake for AFTER the pamper session has concluded).<br />You will also need to provide for a PAMPER PARTY:</p>\n<ul>\n<li>A table (6-seater size dining table or trestle table recommended) and 5 chairs</li>\n<li>A four-seater sofa, or four extra chairs (foot spa station - 1.5 hr + parties only)</li>\n<li>An accessible powerpoint</li>\n<li>Access to warm water and a microwave (2 hour parties only)</li>\n</ul>\n<p><br /><strong>FEATHER BOAS: We use the boas for decoration and the \"catwalk\". Feather Boas molt. Should you wish not to have bits of feather on your floor please let us know before the show and we will refrain from using them.</strong><br />We highly recommended that these parties be held indoors, or an an undercover patio area, with space for the above plus karaoke station and craft station (provided by entertainer).<br /><strong>FOR DISCO PARTIES ONLY:</strong><br />We highly recommend that these parties be set up inside or in a garage, where light can be dimmed and there are walls for the lights to shine on. (so that the disco lights will be effective) and smoke can be used. <br /><strong>FOR SPORTS PARTIES ONLY:</strong><br />We highly recommend that these parties be held in a park or very large grassed backyard only, as a large open area is ideal for ball games and obstacle course.</p>\n<p>Have a GREAT party and I will be in touch to see how it all went next week!</p>\n<p><br /> <b>Warm Regards, </b><br />Stephanie Lee-Harper\n<br>Super Party Heroes<br />(07) 3555 8019</p> email template', '2018-07-12 12:33:18', '2018-07-12 12:33:18', '2018-07-12 12:33:18'),
(295059, 'Email Template', 'Edit', 'Admin edited <p>&nbsp;</p>\n<p>Unfortunately this gig has been cancelled! Probably due to the client not confirming their booking.</p>\nPlease reply cancellation received;<br />\n<br />Date: {{DATE}}\n<br />Time: {{TIME}}\n<br />Character: {{ROLE}}\n<br />Name: {{SHOW_NAME}}\n<br />Email: {{SHOW_EMAIL}}\n<br />Mobile: {{PHONE}}\n<br />Address: {{ADDRESS}}\n<br />Child: {{CHILD_NAME}}\n<br />Age: {{CHILD_AGE}} <br />\n<br /><b>Warm Regards,</b><br />Stephanie Lee-Harper <br />Super Party Heroes<br />(07) 3555 8019<br />admin@supersteph.com</p> email template', '2018-07-12 12:44:23', '2018-07-12 12:44:23', '2018-07-12 12:44:23'),
